
use core::ops::{Add, Sub, Mul, Div};
use core::cmp::Ordering;
use crate::u256::U256;

#[repr(C)]
#[derive(Eq, PartialEq, Debug, Copy, Clone)]
pub struct Field256 {
    pub u: U256,
    pub p: fn() -> U256
}

#[allow(dead_code)]
impl Field256 {
    pub fn new(u: U256, p: fn() -> U256) -> Self {
        Field256 {u: u, p: p}
    }
    pub fn zero(p: fn() -> U256) -> Field256 { Field256 {u: U256::zero(), p: p}}
    pub fn one(p: fn() -> U256) -> Field256 { Field256 {u: U256::one(), p: p}}
    pub fn max_value(p: fn() -> U256) -> Field256 { Field256 {u: p() - U256::one(), p: p}}
    pub fn eliminate(x : (u128, u128, u128), prime: U256) -> U256 {
        match x {
            (0u128, x1, x2) if U256::new(x1, x2) < prime => U256::new(x1, x2),
            (0u128, x1, x2) if U256::new(x1, x2) >= prime => U256::new(x1, x2) - prime,
            (x0, x1, x2) => {
                // let (U256((_, z0)), z) = U256::new(0u128, x0) * prime;
                let multiple = U256::new(0u128, x0) * prime;
                let (_, z0) = multiple.0.unwrap();
                let z = multiple.1;
                let t = U256::new(x1, x2);
                if t >= z {
                    // let U256((w1, w2)) = t - z;
                    let (w1, w2) = (t - z).unwrap();
                    Field256::eliminate((x0 - z0, w1, w2), prime)
                } else {
                    // let U256((w1, w2)) = U256::max_value() - z + t + U256::one();
                    let (w1, w2) = (U256::max_value() - z + t + U256::one()).unwrap();
                    Field256::eliminate((x0 - z0 - 1, w1, w2), prime)
                }
            },
        }
    }

}

impl Add for Field256 {
    type Output = Field256;

    fn add(self, other: Field256) -> Field256 {
        let self_u256 = self.u;
        let other_u256 = other.u;
        let self_p = self.p;
        let other_p = other.p;
        let prime = self_p();
        assert_eq!(prime, other_p());
        let (mut v, o) = self_u256.overflowing_add(other_u256);
        if v > prime {
            v = v - prime;
        }
        if o {
            let p_minus = U256::max_value() - prime + U256::one();
            v = v + p_minus;
        }
        if v > prime {
            v = v - prime;
        }
        Field256 {u: v, p: self_p}
    }
}

impl Ord for Field256 {
    fn cmp(&self, other: &Field256) -> Ordering {
        let self_u256 = self.u;
        let other_u256 = other.u;
        let self_p = self.p;
        let other_p = other.p;
        let prime = self_p();
        assert_eq!(prime, other_p());
        self_u256.cmp(&other_u256)
    }
}

impl PartialOrd for Field256 {
    fn partial_cmp(&self, other: &Field256) -> Option<Ordering> {
        Some(self.cmp(other))
    }
}

impl Sub for Field256 {
    type Output = Field256;

    fn sub(self, other: Field256) -> Field256 {
        let self_u256 = self.u;
        let other_u256 = other.u;
        let self_p = self.p;
        let other_p = other.p;
        let prime = self_p();
        assert_eq!(prime, other_p());
        if self_u256 >= other_u256 {
            Field256 {u: self_u256 - other_u256, p: self_p}
        } else {
            Field256 {u: self_u256, p: self_p} + Field256 {u: prime - other_u256, p: self_p}
        }
    }
}

impl Mul for Field256 {
    type Output = Field256;

    fn mul(self, other: Field256) -> Field256 {
        let self_u256 = self.u;
        let other_u256 = other.u;
        let self_p = self.p;
        let other_p = other.p;
        let prime = self_p();
        assert_eq!(prime, other_p());
        // let (U256((x0, x1)), U256((x2, x3))) = self_u256 * other_u256;
        let multiple = self_u256 * other_u256;
        let (x0, x1) = multiple.0.unwrap();
        let (x2, x3) = multiple.1.unwrap();

        // let U256((y0, y1)) = Field256::eliminate((x0, x1, x2), prime);
        let (y0, y1) = (Field256::eliminate((x0, x1, x2), prime)).unwrap();
        let u = Field256::eliminate((y0, y1, x3), prime);
        Field256 {u: u, p: self_p}
    }
}

impl Div for Field256 {
    type Output = Field256;

    fn div(self, other: Field256) -> Field256 {
        let self_u256 = self.u;
        let other_u256 = other.u;
        let self_p = self.p;
        let other_p = other.p;
        let prime = self_p();
        assert_eq!(prime, other_p());
        let f1 = Field256 {u: self_u256, p: self_p};
        let f2 = Field256 {u: other_u256.mod_inv(prime), p: self_p} ;
        let r =  f1 * f2;
        r
    }
}

