    #[test]
    fn field256_order() {
        let compare = Field256::one(P) == Field256::one(P);
        assert!(compare);
        let compare = Field256::one(P) > Field256::zero(P);
        assert!(compare);
        let compare = Field256::zero(P) < Field256::one(P);
        assert!(compare);
    }

